import React from 'react';
import '../css/Footer.css';

function Footer() {
  return (
    <div className='footer'>

      <div className='address'><h5>오시는 길 : 광주광역시 광산구 소촌로152번길 37</h5></div>
      <div className='github'><h5>https://github.com/20153306Kimgunwoo/silver-car-community</h5></div>
      <div className='team_name'><h5>1조 : 김건우, 이승찬, 조정아, 강다솜</h5></div>
    </div>
  );
}

export default Footer;
